    computed: mapState(['soakRecvData']),
    watch: {
      soakRecvData(newVal) {
        this.leftOption.series[0].data[0].value = newVal.value
        this.leftOption.series[0].name = common.getTime(newVal.time)
        this.leftChart.setOption(this.leftOption)
      }
    },
    mounted() {
      this.initLeftChart()
      this.initRightChart()
    },
    methods: {
      async initLeftChart() {
        this.leftChart = this.$echarts.init(document.getElementById('soak-left'))
        this.leftChart.showLoading()
        await this.getLeftData()
        this.findByBigTypeAndSubIndex()
        this.leftChart.hideLoading()
        this.leftChart.setOption(this.leftOption)
      },
      async initRightChart() {
        this.rightChart = this.$echarts.init(document.getElementById('soak-right'))
        //数据加载
        this.rightChart.showLoading()
        await this.mountedRightData()
        //关闭加载
        this.rightChart.hideLoading()
        this.rightChart.setOption(this.rightOption)
      },
      mountedRightData() {
        this.rightOption.xAxis.forEach(xAxis => xAxis.data = this.timeData)
        this.rightOption.series[0].data = this.flowData
        this.rightOption.series[1].data = this.rainfallData
      },
      async getLeftData() {
        await soakService.findNewestData().then(res => {
          if (res.code === 0) {
            this.leftOption.series[0].data[0].value = res.obj.value
            this.leftOption.series[0].name = common.getTime(res.obj.createTime)
          }
        })
      },
      findByBigTypeAndSubIndex() {
        typeService.findByBigTypeAndSubIndex({bigType: this.bigType, subIndex: 0}).then(res => {
          if (res.code === 0) {
            this.LIMIT_VALUE = res.obj.limitValue
          }
        })
      },
      updateLimitValue() {
        typeService.updateLimitValue({bigType: this.bigType, subIndex: 0, limitValue: this.inputModel}).then(res => {
          if (res.code === 0) {
            this.LIMIT_VALUE = Number(this.inputModel)
            this.inputModel = null
          }
        })
      },
      exportExcel(bigType) {
        exportService.exportExcel(bigType)
      },
      disableUpdateLimitBtm(inputModel){
        return this.loginIsAdmin === 0 ? true : ! inputModel
      }
    }
  }
